import React from 'react'
import { Menu } from 'antd';

function Navbar() {
    return (
        <div>
            <div>
                <Menu mode="horrizontal" defaultSelectedKeys={['1']}>
                    <Menu.Item key='1'>Home</Menu.Item>
                    <Menu.Item key='2'>About Us</Menu.Item>
                    <Menu.Item key='3'>Contact Us</Menu.Item>
                </Menu>
            </div>
        </div>
    )
}

